trailingComments.value:
*
 * 打开签到页
 *
 * 支持平台：书旗Android、书旗iOS
 *
 * @return {Promise<void>}
 *
 * @example
 * libSQ.exec('open-sign-in-page').catch((err) => {
 *   alert(`[open-sign-in-page][error] ${JSON.stringify(err, null, 2)}`);
 *   const e = err.detail.__$rawError__;
 *   alert(e.message);
 *   alert(e.stack);
 * });

